Kieran has started to notice that some of his belongings have gone missing from his hotel room. On his way out, he asks his maid Megan to see if she can find his things while she cleans his room. When he returns unexpectedly, he catches Megan in the act of stealing cash from his wallet. Turns out sexy this little thief has been robbing him blind ever since he checked in. Not wanting to lose her job, Megan begs for forgiveness, so Kieran decides to repay her deceit the only way he knows how, PSP style!
